import '../C_dashboard/style_dashboard.css';
import NavBar from '../C_dashboard/NavBar';
import Profile from '../C_dashboard/Profile';
function Dashboard() {
  
  return (    
    <div class="adashboard">
        <NavBar menuoption="feed"/>
        <Profile userprofile_path="rms\src\C_dashboard\user_profiles\AU1841139.jpeg" userprofile_about="Student" user_school="Schhol of Enginnering and Applied Science" user_degree="Bachelor in Technology in Information and Communication Technology"/>
    </div>  
  );
}

export default Dashboard;
